column2:
L'objecte del contracte és l'assessorament jurídic en la tramitació del PDU de revisió dels  sòls no sostenibles de Malgrat de Mar a Alcanar, que en tot cas inclourà:

-	Confecció d'un marc jurídic general per a la resposta a les al·legacions i als informes rebuts durant la tramitació.
-	El resum i la resposta de les al·legacions rebudes en la fase d'informació pública;
-	El resum i la resposta dels escrits rebuts en fase d'audiència als Ajuntaments;
-	El resum i resposta dels informes rebuts en la tramitació; i
-	L'assessorament en la redacció de la normativa urbanística i d'integració paisatgística si s'ha de canviar a la llum de les al·legacions i/o informes rebuts en la tramitació.
